import React from 'react';

export default function AdminDashboard() {
  return (
    <div>
      <h1 className="text-3xl font-bold text-blue-600 mb-6">Admin Overview</h1>

      <div className="grid grid-cols-1 sm:grid-cols-2 lg:grid-cols-3 gap-6">
        {/* Logged-in user */}
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-sm text-gray-500">Logged in as</h2>
          <p className="text-lg font-semibold">ultamatthew</p>
        </div>

        {/* Users */}
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-sm text-gray-500">Total Users</h2>
          <p className="text-2xl font-bold text-blue-600">—</p>
        </div>

        {/* System status */}
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-sm text-gray-500">System Status</h2>
          <p className="text-lg font-semibold text-green-600">All systems operational</p>
        </div>

        {/* Forums (placeholder) */}
        <div className="bg-white p-6 rounded-lg shadow">
          <h2 className="text-sm text-gray-500">Total Forums</h2>
          <p className="text-2xl font-bold text-blue-600">—</p>
        </div>
      </div>
    </div>
  );
}
